import './App.css';
import { useEffect } from 'react';

function App() {

  return (
    <div class='listContainer'>
      <ul>
        <li>스파게티</li>
        <li>파스타</li>
        <li>스테이크</li>ㄴ
        <li>타코</li>
        <li>비빔밥</li>
        <li>오징어볶음</li>
        <li>된장찌개</li>
        <li>삼겹살</li>
        <li>분짜</li>
      </ul>
    </div>
  )
}

export default App;
